import React from 'react';
import '../styles/ImageCard.css';

const ImageCard = ({ type, data, onClick }) => {
  if (type === 'category') {
    const { name, images, count } = data;
    return (
      <div className="card category-card" onClick={onClick}>
        <div className="image-grid">
          {images.slice(0, 4).map((image, index) => (
            <img
              key={image.id || index}  // Added index as fallback for image keys
              src={image.src}
              alt={`Category Image ${index + 1}`}
              className="thumbnail"
            />
          ))}
        </div>
        <div className="category-info">
          <h3>{name}</h3>
          <p>{count} Images</p>
        </div>
      </div>
    );
  } else if (type === 'image') {
    const { src, name, date } = data;
    return (
      <div className="card image-card" onClick={onClick}>
        <img src={src} alt={name} className="thumbnail" />
        <div className="image-info">
          <h4>{name}</h4>
          <p>{date}</p>
        </div>
      </div>
    );
  }
  return null;
};

export default ImageCard;
